import React from "react";
import './Announcements.css';
import {useLocation} from 'react-router-dom';


function Announcements(corid){
    const location = useLocation();
    let Announcements=['Assignment that takes 2 month but you have one week','something important','there is a new assignment Could not find a declaration file for module react-quiz-componentf:/REACT/basic-oper/node_modules/react-quiz-component/lib/Quiz.js implicitly has an type. Try `npm i --save-dev @types/react-quiz-component` if it exists or add a new declaration (.d.ts) file containing `declare module ','zooomlink for classss slide reading ','latex Assignment'];
    corid=location.state && location.state.corid;
    return(<div class="ann">
    
        <table>
            <tr>
                <th class="table-head"> ANOUNCEMENT </th>
                <th class="table-head"> DESCRIPTION </th>

            </tr>
              {Announcements.map((item =>
                <tr><td>{Announcements.indexOf(item)}</td>
                    <td> {item} </td>
              </tr> ))}
            </table>
          <p>{corid}</p>
        
        </div>
        )
    ;
;}

export default Announcements;
